export const RoommatesMap = () => {
  return (
    <S.RoommatesMapWrapper>
      <S.RoommatesMapContent>
        <S.Rooms>
          <S.Room>
            imagem
            <div>Titulo</div>
          </S.Room>
        </S.Rooms>
        <S.Map>Mapa</S.Map>
      </S.RoommatesMapContent>
    </S.RoommatesMapWrapper>
  );
};
